$(document).ready(function() {
  /*-  js-accordion-*/
  $('.js-accordion').on('click touchstart', function (e) {
  	e.preventDefault();
  	var $this = $(this);
  	var $way = $(this).data('accord');

  	if($this.closest('.'+$way).is('.is-active')){
  		$this.closest('.'+$way).removeClass('is-active');
  	} else {
	  	$('.'+ $way).removeClass('is-active');
	  	$this.closest('.'+$way).addClass('is-active');
	  }
  });
});

$(document).ready(function () {
   var peoples = 0,
   tenpeoples = 0,
   hungredpeoples = 0,
   thouthendpeoples = 0;

   window.setInterval(
    function () {
    	peoples += (90 / 60);
        $('.peoples').css({'top': -peoples});
    }, 1000);

   setInterval(function () {
   	peoples = 0;
   }, 600000);

   window.setInterval(
    function () {
    	tenpeoples +=(90 / 60);
        $('.tenpeoples').css({'top': -tenpeoples});
    }, 10000);

   setInterval(function () {
   	tenpeoples = 0;
   }, 6000000);

   window.setInterval(
    function () {
    	hungredpeoples +=(90 / 60);
        $('.hungredpeoples').css({'top': -hungredpeoples});
    }, 1000000);

   setInterval(function () {
   	hungredpeoples = 0;
   }, 600000000);

   window.setInterval(
    function () {
    	thouthendpeoples +=(90 / 60);
        $('.thouthendpeoples').css({'top': -thouthendpeoples});
    }, 100000000);

   setInterval(function () {
   	thouthendpeoples = 0;
   }, 60000000000);


	});


